static int casadi_f8(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  int flag;
  struct casadi_qp_data d_qp;
  struct casadi_qp_prob p_qp;
  struct casadi_qrqp_data d;
  struct casadi_qrqp_prob p;
  d_qp.prob = &p_qp;
  p_qp.sp_a = casadi_s0;
  p_qp.sp_h = casadi_s1;
  casadi_qp_setup(&p_qp);
  casadi_qp_init(&d_qp, &iw, &w);
  d_qp.h = arg[0];
  d_qp.g = arg[1];
  d_qp.a = arg[2];
  d_qp.lbx = arg[5];
  d_qp.ubx = arg[6];
  d_qp.lba = arg[3];
  d_qp.uba = arg[4];
  d_qp.x0 = arg[7];
  d_qp.lam_x0 = arg[8];
  d_qp.lam_a0 = arg[9];
  d_qp.f = res[1];
  d_qp.x = res[0];
  d_qp.lam_x = res[3];
  d_qp.lam_a = res[2];
  p.qp = &p_qp;
  p.sp_at = casadi_s2;
  p.sp_kkt = casadi_s3;
  p.sp_v = casadi_s4;
  p.sp_r = casadi_s5;
  p.prinv = casadi_s6;
  p.pc =  casadi_s7;
  casadi_qrqp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-08;
  p.dual_inf_tol = 1e-08;
  d.prob = &p;
  d.qp = &d_qp;
  casadi_qrqp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 54, d.lbz);
  } else {
    casadi_fill(d.lbz, 54, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 30, d.lbz+54);
  } else {
    casadi_fill(d.lbz+54, 30, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 54, d.ubz);
  } else {
    casadi_fill(d.ubz, 54, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 30, d.ubz+54);
  } else {
    casadi_fill(d.ubz+54, 30, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 54, d.z);
  } else {
    casadi_clear(d.z, 54);
  }
  casadi_fill(d.z+54, 30, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 54, d.lam);
  } else {
    casadi_clear(d.lam, 54);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 30, d.lam+54);
  } else {
    casadi_clear(d.lam+54, 30);
  }
  /* Solve QP */
  if (casadi_qrqp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qrqp_prepare(&d);
    if (flag || casadi_qrqp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 54, res[0]);
  if (res[3]) casadi_copy(d.lam, 54, res[3]);
  if (res[2]) casadi_copy(d.lam+54, 30, res[2]);
  if (d.status == QP_SUCCESS) {;
    return 0;
  } else if (d.status == QP_NO_SEARCH_DIR) {
    return 4;
  } else {
    return -1;
  }
  return 0;
}

